function Card(props){
  function handleClick() {
    props.onCardClick(props.card);
  }
  return (
    <article className="element">
      <button type="button" className="element__delete-button"></button>
       {/*  <img
          src={props.card.link}
           alt={props.card.name}
          className='element__image'
          onClick={handleClick}
        /> */}
      <div className="element__image" style={props.style} onClick={handleClick}></div>
      <div className="element__heading">
        <h2 className="element__heading-text">{props.name}</h2>
        <div className="element__like-wrap">
          <button type="button" className="element__like-button"></button>
          <span className="element__like-count">{props.likes}</span>
        </div>
      </div>
    </article>
  )
}

export default Card;
